import React from 'react';
import logo from './open.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://image.freepik.com/free-vector/covid-19-coronavirus-delivery-woman-protective-medical-mask-brought-parcel-quarantined-man-apartment-picks-up-cardboard-box-from-courier-order-food-self-isolation_208509-100.jpg" />
      </header>
    </div>
  );
}

export default App;
